import './Form.css';
import Logo from '../../../assests/logo.jpg';

export default function Form() {
    return (
        <div className="Form">
            <form method="POST">
                <div className="container2">
                <img src={Logo}
                        alt="logo"
                        width='240px'
                        height='220px' 
                    />
                </div>
            </form>
        </div>
    )
}
